alter table zz_import_20100719_carrier add rowid int identity(1,1)
alter table zz_import_20100719_carrier add phone varchar(255)
alter table zz_import_20100719_carrier add phoneExt varchar(255)
alter table zz_import_20100719_carrier add fax varchar(255)

update zz_import_20100719_carrier
set phone= replace(EligibilityPhoneNumber, '(', '')
update zz_import_20100719_carrier
set phone= replace(phone, ')', '')
update zz_import_20100719_carrier
set phone= replace(phone, '-', '')
update zz_import_20100719_carrier
set phone= replace(phone, ' ', '')

update zz_import_20100719_carrier
set fax= replace(FaxNumber, '(', '')
update zz_import_20100719_carrier
set fax= replace(fax, ')', '')
update zz_import_20100719_carrier
set fax= replace(fax, '-', '')
update zz_import_20100719_carrier
set fax= replace(fax, ' ', '')



