update ic
set vendorId=z.rowID
	, vendorImportId=1
from insuranceCompany ic
	inner join dbo.zz_import_20100719_carrier z
		on 'rowid:'+ cast(z.rowid as varchar(50))=cast(ic.notes as varchar(max))

update ic
set notes='Kareo Imported 7/19/2010
EDICIDNumber:'+isnull(EDICPIDNumber,'')+'
CarrierCode:' +isnull(CarrierCode, '')
from insuranceCompany ic
	inner join dbo.zz_import_20100719_carrier z
		on ic.vendorId=z.rowId
		

