update icp
set addressline1=ic.addressline1
	,addressline2=ic.addressline2
	,city=ic.city
	,state=ic.state
	,zipCode=ic.zipCode
	,Phone=ic.Phone
from insuranceCompanyPlan icp
	inner join insuranceCompany ic
		on ic.insuranceCompanyId=icp.insuranceCompanyid
where ic.vendorImportId=1


alter table dbo.zz_import_20100719_insurancePolicy add insuranceCompanyID int 
alter table dbo.zz_import_20100719_insurancePolicy add insuranceCompanyPlanID int
alter table dbo.zz_import_20100719_insurancePolicy add patientId int 
alter table zz_import_20100719_insurancePolicy add rowid int identity(1,1)


declare @vendorImportId int
set @vendorImportId=1


update zip
set insuranceCompanyID=i.insuranceCompanyID
from dbo.zz_import_20100719_carrier z
	inner join insuranceCompany i
		on i.vendorId=z.rowId
	inner join zz_import_20100719_insurancePolicy zip
		on zip.CarrierFID=z.Carrier_UID
where i.VendorImportId=@vendorImportId


update zip
set insuranceCompanyPlanID=i.insuranceCompanyPlanID
from dbo.zz_import_20100719_insurancePolicy zip
	inner join insuranceCompanyPlan i
		on i.insuranceCompanyId=zip.insuranceCompanyId
where i.VendorImportId=@vendorImportId



update zip
set patientId=p.patientId
from dbo.zz_import_20100719_insurancePolicy zip
	inner join dbo.zz_import_20100719_patientInfo zp
		on zip.PatientFID=zp.Patient_UID
	inner join patient p
		on p.vendorId=zp.rowID
where p.VendorImportId=1





declare @vendorImportID int
select @vendorImportID=1

INSERT INTO [dbo].[Patient](
	prefix,
	Suffix,
	MiddleName,
	[PracticeID],
	[FirstName],
	[LastName],
	[AddressLine1],
	[AddressLine2],
	[City],
	[State],
	[ZipCode],
	[HomePhone],
	WorkPhone,
	WorkPhoneExt,
	MobilePhone,
	[DOB],
	SSN,
	[Gender],
	[VendorID],
	MedicalRecordNumber,
	VendorImportID,
	CollectionCategoryID,
	DefaultServiceLocationID,
	PrimaryProviderID,
	EmailAddress,
	EmploymentStatus,
	EmployerID,
	MaritalStatus
	)
SELECT 
	'',
	'',
	left(isnull(MiddleName, ''), 1) as MI,
	1,
	left(isnull([firstname], '') , 64),
	left(isnull( [lastname], ''), 64),
	left([Address2], 256),
	left([Address1], 256),
	left(i.[City], 128),
	case when len(state)>2 then null else [State] end,
	zip = left( cast(
				--	cast(
							case when isnumeric( replace([ZipCode], '-', ''))= 1 then replace([ZipCode], '-', '')  else null end
				--		as bigint) 
					as varchar(32))
				, 9
			),
	case when len(replace(replace(replace(replace([HomePhone], '-', ''), ')', ''), '(', ''), ' ', '') ) > 10 then null else cast( replace(replace(replace(replace([HomePhone], '-', ''), ')', ''), '(', ''), ' ', '')  as varchar(max) ) end as phoneHome,
	case when len(replace(replace(replace(replace(OfficePhone, '-', ''), ')', ''), '(', ''), ' ', '') ) > 10 then null else cast( replace(replace(replace(replace(OfficePhone, '-', ''), ')', ''), '(', ''), ' ', '')  as varchar(max) ) end  as phoneWork,
	case when isnumeric(OfficeExtension)=1 then OfficeExtension else null end as phone_work_ext,
	case when len(replace(replace(replace(replace(Cell, '-', ''), ')', ''), '(', ''), ' ', '') ) > 10 then null else cast( replace(replace(replace(replace(Cell, '-', ''), ')', ''), '(', ''), ' ', '')  as varchar(max) ) end  as phoneWork,
	DOB dob,
	SSN = cast(
		case when isnumeric( replace(SSN, '-', ''))=0 then null else isnumeric( replace(SSN, '-', '')) end
		 as bigint),
	LEFT(Gender, 1),  
	rowid as [VendorID], -- vendorID
	left(ChartNumber, 128) as  MRN,
	@vendorImportID, -- vendorID
	1,
	null as serviceLocationID,
	null as primaryProviderID,
	left(isnull(Email, null), 256) as Email,
	EmploymentStatus = left(null,1) ,
	null EmployerID,
	LEFT(null, 1) as MaritalStatus
from dbo.zz_import_20100719_patientInfo i
where not exists(select * from patient p where p.vendorID=i.rowID and p.vendorImportID=@vendorImportID)




