insert into dbo.InsurancePolicy(
	PatientCaseID
	,InsuranceCompanyPlanID
	,Precedence
	,PolicyNumber
	,GroupName
	,GroupNumber

	,CardOnFile
	,PatientRelationshipToInsured
	,HolderThroughEmployer
	,PatientInsuranceStatusID
	,VendorID
	,VendorImportID
	,PracticeID
	,Copay
)
select 
	pc.PatientCaseID
	,z.InsuranceCompanyPlanId
	,SequenceNumber
	,SubscriberIDNumber as Policy
	,left( nullif(GroupName, ''), 14)a
	,nullif(GroupNumber, '') as [Group]
	,0 as CardOnFile
	,'S' as PatientRelationshipToInsured
	,0 as HolderThroughEmployer
	,0 as PatientInsuranceStatusID
	,z.rowID as VendorID
	,@vendorImportId as VendorImportID
	,pc.PracticeID
	,z.CopayDollarAmount
from zz_import_20100719_insurancePolicy z
	inner join PatientCase pc (nolock)
		on pc.patientID=z.patientID	
where pc.vendorImportID=@vendorImportId
	and InsuranceCompanyPlanId is not null
order by pc.PatientCaseID, SequenceNumber





update p
set ssn= case when len(z.ssn)=9 then z.ssn else null end
from patient p
	inner join zz_import_20100719_patientInfo z
		on z.rowId=p.vendorId
where VendorImportId=1
